(()=>{"use strict";class e{static loadHomepage(){const t=document.querySelector(".inbox"),c=document.querySelector(".today"),o=document.querySelector(".week");t.addEventListener("click",e.loadInbox),c.addEventListener("click",e.loadToday),o.addEventListener("click",e.loadNextWeek),document.querySelector(".project-content")}static loadInbox(){const e=document.querySelector(".project-content"),t=document.querySelectorAll(".nav-btn"),c=document.querySelector(".inbox");t.forEach((e=>e.classList.remove("active"))),c.classList.add("active"),e.innerHTML="Test"}static loadToday(){const e=document.querySelector(".project-content"),t=document.querySelectorAll(".nav-btn"),c=document.querySelector(".today");t.forEach((e=>e.classList.remove("active"))),c.classList.add("active"),e.innerHTML="Test2"}static loadNextWeek(){const e=document.querySelector(".project-content"),t=document.querySelectorAll(".nav-btn"),c=document.querySelector(".week");t.forEach((e=>e.classList.remove("active"))),c.classList.add("active"),e.innerHTML="Test3"}}document.addEventListener("DOMContentLoaded",e.loadHomepage)})();